import classes from './MealItem.module.css';



const MealItem = props => {
    const meals = props.meals.map(meal => {
        return (<li className={classes.meal}><div><h3>{meal.name}</h3>
            </div><p className={classes.description}>{meal.description}</p><p className={classes.price}>{meal.price}</p></li>)
    })
return(
{meals}
)
}


export default MealItem;
